import React from 'react';

function Hero() {
  return (
    <section className="hero">
      <div className="hero-content">
        <h1>Invest in Your Future</h1>
        <p>Discover a world of mutual funds tailored to your financial goals. Let us help you build a prosperous future through smart, diversified investments.</p>
        <div className="hero-buttons">
          <a href="/get-started" className="btn btn-primary btn-large">Get Started</a>
          <a href="/learn-more" className="btn btn-outline btn-large">Learn More</a>
        </div>
      </div>
    </section>
  );
}

export default Hero;
